import React, { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios.get('http://localhost:5000/api/predictions?temperature=25&pressure=1000') // Replace with your API endpoint
      .then((response) => {
        setData(response.data);
        setLoading(false);
      })
      .catch((error) => {
        console.error(error);
        setLoading(false);
      });
  }, []);

  return (
    <div>
      <h2>Predictions</h2>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <ul>
          {data.map((item) => (
            <li key={item._id}>
              <div>Temperature: {item.temperature}</div>
              <div>Pressure: {item.pressure}</div>
              {/* Display other fields as needed */}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default App;
